<script>
  const form = document.querySelector("#form")
  const scriptURL = 'https://script.google.com/macros/s/AKfycbxr9MoAo683_qdw6PMrgkk0KNpTfZXMmiA3-PAcJvmzm9cVqrCYuikpSMSr1n9SkXIz/exec'

  form.addEventListener('submit', e => {
    e.preventDefault()

    const responseBody = new FormData(form)
    const TrendBody = responseBody.getAll("TRENDS").join(" ")
    responseBody.set('TRENDS', TrendBody)
    fetch(scriptURL, { method: 'POST', body: responseBody })
      .then(response => { alert('Comp Pass Order Recorded!', response) })
      .catch(error => alert('Error!', error.message))
  })

  function fun_remove() {
         var element = document.getElementById("id_dropdown");
         element.remove(element.selectedIndex);
      }

</script>
